NSAMPLES = 16
NREADS = 250

#sampler = EmbeddingComposite(DWaveSampler())
sampler = EmbeddingComposite(DWaveSampler(solver=dict(topology__type='zephyr')))
sampler_v = 2

PROBLEM = - new_NTR_10_NNODI_6_2
PROBLEM_NAME = 'new_NTR_10_NNODI_6_2'

if sampler_v == 2:
    AdvVERSION = 'Adv2'
else:
    AdvVERSION = 'Adv1'

header = PROBLEM_NAME + '_' + AdvVERSION + '_' + str(NSAMPLES) + 'x' + str(NREADS)

with open('output_' + header + '_' + str_time + '.txt', mode='w') as file_object:
    print("INFO --- " + header + "       - Samples = " + str(NSAMPLES) + "       - Reads per sample = " + str(NREADS), file=file_object)
    for i in range(0, NSAMPLES):

        sampleset = sampler.sample_qubo(PROBLEM, num_reads=NREADS, label=header)

        for datum in sampleset.data(fields=['sample', 'energy', 'num_occurrences']):
            print("\'", datum, "\', ", file=file_object)
        print("INFO --- END OF SAMPLE " + str(i + 1), file=file_object)
        print(sampleset)
        dwave.inspector.show(sampleset)

